INSERT INTO `data` VALUES ('rules','<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">a) Youphenom is a social-networking-style platform that enables users to create \"Profiles\" to express and display their ideas, views, photos, also topics/activities/objects they like. These Profiles are represented in the form of \"Teams\" competing in \"Leagues\". The Teams only compete with other teams in the same League, but the Teams are grouped in the different Leagues not according to related themes, topics, or categories reflected in the Profiles, but according to the \"ranking\" of the Teams based on their record of performance.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">b) All the <span style=\"font-size: 10pt;\">teams in Youphenom are created by users. The Leagues have no relation to any actual existing Leagues. The Teams in Youphenom&nbsp;are not intended to have any relation to actual Teams. If the user chooses to use actual Team\'s (or other entity) features, such as but not limited to Name, Colors, Logo, IT\'S THE RESPONSIBILITY OF THE USER TO OBTAIN ANY NECESSARY LICENSES, COPYRIGHTS, OR OTHER PROPRIETARY RIGHTS PRIOR TO START USING THESE FEATURES!</span></span></p>\r\n<p><span style=\"font-size: 10pt;\"><span style=\"font-family: Arial, Helvetica, sans-serif; text-align: justify;\">c) </span><span style=\"font-family: arial, helvetica, sans-serif;\">Each user has one (1) Free-Vote per day to use at their discretion (including voting for a team owned by the user). Unused Free-Votes expire at the end of each day.<br></span></span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">To place more votes on the same day, the users need to shop for votes, which are then reflected in their Vote-Accounts. These votes do not expire.</span></p>\r\n<p class=\"p1\"><span class=\"s1\" style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">A user can submit only one (1) vote for the same team on the same day. Exception is the Free Daily Vote, which can be submitted in addition to a vote from the account. - Thus, on any given day a user could vote twice (free vote + vote from account) for one of the teams and only once for any other team.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 10pt; text-align: justify;\">Unlimited number of teams is allowed per user account. After the first team is created free of charge, in-app purchase is required for each new team after that.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 10pt; text-align: justify;\">Each new team is assigned to the highest possible League on the first come first serve basis. After creating a Team and choosing Team Name, Team Colors, etc., it\'s up to the user to promote the Team to accumulate vote-points.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\"><span style=\"font-size: 10pt;\">d) The Teams compete against one another based on the number of VOTES (+1 VOTE-POINT for each vote/like received) the teams get during the \"Game\"/\"Match\" (or the whole Season in th</span>e case with the Conference League).</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">e) There are 4 Leagues: L1 (highest ranking), L2, L3, L4 with 28 teams in each League + there is the CONFERENCE-League (the lowest ranking) with unlimited number of teams.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">f) Each Game in the 4 Leagues continues 24 hours, during which the teams are getting VOTES/LIKES (1 VOTE = 1 VOTE-POINT) from the users (fans). On the first day of the month there are 14 games (14 pairs of teams) and they play 27 days until every team has played against all the teams in the League. For each win the teams receive 3 points, 1 point for a draw, and 0 points for a loss. (In the Conference League there are no Games/Matches (pairs of teams), the Standings during and at the end of the Season (Month) are based on the amount of votes/likes accumulated by each team throughout the current Season). After the 27th day based on the ranking, the teams are paired in Playoff Games/Matches. The number of points determines the ranking of a team (more points = higher ranking in the standings). If two or more teams have the same number of points the following criteria will be used: (i) greater number of points obtained in the matches between the teams in question, (ii) greater total number of votes during the season, (iii) the team that was created first, (iv) drawing of lots by the Youphenom&nbsp;software system. (Please note the Standings in the Conference are updated in \"real time\", as the Standings in the L1, L2, L3 and L4 are updated only at the end of the Game-day when the game is finished and the distribution of the points for all teams is definite).</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">g) Playoffs - Playoffs are played in L1, L2, L3 and L4, but not in the Conference League. Playoffs determine the Champion of the particular League and the Teams that will shift to the superior League, but Playoffs don\'t have any effect on the point calculation for the regular season Standings. The teams bound for the Playoffs are highlighted in golden color and the Playoffs are played as follows: (i) for the months with 31 days (as there are 4 extra days after the 27 days of the \"regular\" Season) - Day 28 - Round of 16, Day 29 - Quarter-finals, DaYy 30 - Semi-finals and Day 31 - Final. In the \"Round of 16\" Team1 will play with Team16, T2-T15, T3-T14, T4-T13, etc. The same for the next rounds the team with the best ranking plays the team with the lowest and so forth. The best 8 teams (those that qualify for the Quarter-finals) will advance for the next superior League for the next Season; (ii) for the months with 30 days (as there are only 3 extra days) there will be no \"Round of 16\", but only Quarter-finals, Semi-finals and Final; (iii) for the months with 29 days - Semi-finals and Final; (iv) for the months with 28 days there will be only final, still 8 teams advance to the next superior League (the 2 finalists + the 3rd-8th place teams during the regular Season). If two teams tie in a Playoff game, the team that ranked better in the regular Season wins.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">h) The next Season starts on the 1st day of the next month. The top 8 teams from League2 shifted to League1 and the 8 lowest ranking teams in League1 are now shifted to League2, still 28 teams in each of the Leagues. The same applies to the rest of the Leagues and the Conference. No teams will be relegated from the Conference League since there is no lower ranking League.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Please note that in the Standings, although the golden line indicates the 8 teams that will shift to the next superior League and the white line indicates the 8 teams that will shift to the next lower League for the next Season, they should be used only as guidance, because they may be certain periods and scenarios when this lines are not perfectly accurate. One such case is if there is a team marked by its owner for deletion, as this may affect the calculation of the promotion/relegation, since the deleted teams will be favored for relegation (and ultimately deleted after the end of the Season). For example if there is a deleted team ranked 18th at the end of the regular Season, this team will be relegated instead of the team ranked 21st (best ranked team in the relegation zone), so until the Standings for the next day are calculated, the white line will not represent accurately the exact 8 teams that will be actually relegated.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">i) Comments, photos and links to videos can be posted on the Team Profile pages, User Profile pages and Game pages. The users can choose to use their username or the name of one of the teams they own before submitting each post. Users can delete only their own posts.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">j) Users can post/sell advertising, sponsorships, or promotions ONLY within the areas specifically designated for this purpose.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">k) The aspect ratio for the Sponsored Advertisement is 14:5 and the actual width/height is 140:50.</span></p>\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">&nbsp; </span></p>\r\n<p>&nbsp;</p>'),('about','<h1>About Us</h1>\r\n<p>Imagine watching your favorite team play, and the team desperately needs to score a point. All you can do is sit tight, and hope good things happen. Too bad no sports association in the world allows the fans to score for their teams. Youphenom&nbsp;is here to change that! Be part of the action. Cast your vote to score points, and help your beloved team win. But why stop here?</p>\r\n<p>Start your own team, get fans and followers, turn your franchise into a world-class brand.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span> is a new generation Reality Game (Competitive Social Network) - leave the world of fantasy games behind and start your own Real Franchise Brand. While it\'s based on competing and winning, Youphenom&nbsp;is not necessarily a sport league, because you can develop your brand into almost anything you can think of.</p>\r\n<p>&nbsp;</p>\r\n<p>Join now and experience the social networking like never before.</p>'),('privacy','<h1>Privacy Policy</h1>\r\n<p>Youphenom takes your privacy seriously. Please read the following Privacy Policy to learn how we are using information and the ways in which you can protect your privacy.</p>\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span> receives and collects personal and non-personal information, including information related to your past use of Youphenom services. This Privacy Policy describes how Youphenom treats, uses, stores and protects the information received and collected in connection with Youphenom\'s&nbsp;Services.</p>\r\n<p>By installing, using, registering to or otherwise accessing the services, you agree to this Privacy Policy and give an expressly consent to our collection, retention, use, processing, and disclosure of your personal information as described in this Privacy Policy. If you do not agree to this Privacy Policy, please do not install, use, register to or otherwise access the services.</p>\r\n<p>This policy only applies to Youphenom and does not apply to the practices of companies that Youphenom does not own or control, or to people that Youphenom&nbsp;does not employ or manage.</p>\r\n<p>Collecting and using information</p>\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span>&nbsp;collects and uses variety of information in order to maintain and improve our services, develop new ones and provide better overall user experience including, but not limited to: custom advertising and content you see, fulfill your requests for products and services, contact you, troubleshoot problems, conduct research, and provide anonymous reporting for internal and external clients.</p>\r\n<p>Personal information is collected when you register with Youphenom, when you use Youphenom products and services, when you visit Youphenom pages or the pages of certain Youphenom partners. Personal information is information about you that is personally identifiable and specifically identifies you as an individual like your name, address, email address, or phone number, and that is not otherwise publicly available. Youphenom&nbsp;may combine information about you that we have with information we obtain from business partners or other companies.</p>\r\n<p>Other(non-personal) information that does not directly identify you including aggregate, depersonalized and non-personal information such as, but not limited to (i) Device information and properties, (ii) Log information and details of how you use the service, (iii) Game progress, score and achievements, (iv) Unique application numbers, (v) Information (including personal information) collected and stored locally on your device using mechanisms such as browser web storage (including HTML 5) and application data caches, (vi) Location data - IP address, nearby Wi-Fi access and cell towers, GPS location (your GPS location is not accessed without your consent).</p>\r\n<p>Cookies, pixel tags, web beacons, and other similar anonymous identifiers and technologies may also be used by Youphenom\'s&nbsp;services in order to optimize your user experience and help us to monitor the quality and effectiveness of ads, services and products.</p>\r\n<p>Information sharing and disclosure</p>\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span> does not rent, sell, or share personal information about you with other people or non-affiliated companies except to provide products or services you\'ve requested, when we have your permission, or under the following circumstances: (i) To meet any applicable law, regulation, legal process or enforceable governmental request, (ii) To detect, investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of Youphenom\'s Terms of Service, or as otherwise required by law, (iii) To provide information to trusted partners who work on behalf of or with Youphenom under confidentiality agreements. These companies may use your personal information to help Youphenom communicate with you about offers from Youphenom and our marketing partners. However, these companies do not have any independent right to share this information, (iv) If Youphenom is acquired by or merged with another company. In this event, Youphenom&nbsp;will notify you before information about you is transferred and becomes subject to a different Privacy Policy.</p>\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span> works with partners, advertisers, publishers, vendors and other organizations in different industries and categories of business. You recognize and agree that the analytics companies utilized by Youphenom&nbsp;may combine the information collected with other information they have independently collected from other services or products relating to your activities. These companies collect and use information under their own Privacy Policies.</p>\r\n<p>Please be aware of the open nature of certain social networking and other open features of the services Youphenom may make available to you. You may choose to disclose information about yourself in the course of contributing user generated content to our services. Any information that you disclose in any of these forums, blogs, chats or the like is public information, and there is no expectation of privacy or confidentiality. The fact that Youphenom is linking to products or services of third party organizations does not constitute our sponsorship of, or affiliation with, these organizations. Your access to and use of Youphenom services may be subject to certain third party Terms of Use and Privacy Policies. You understand and agree that Youphenom&nbsp;is not liable for any such third party Terms of Service and their use of your personal information.</p>\r\n<p>Other</p>\r\n<p>* You can edit your Youphenom&nbsp;account information at any time. (Verification of your identity may be requested).</p>\r\n<p>You can also delete your Youphenom&nbsp;account. We may retain certain information from deleted accounts in our archived records to comply with the law, assist with any investigation, prevent fraud, enforce our Terms of Service and Privacy Policy, or take other actions permitted by law.</p>\r\n<p>* Youphenom follows generally accepted industry standards and maintains reasonable safeguards to attempt to ensure the security, integrity and privacy of the information in Youphenom?s possession. We limit access to personal information about you to employees who we believe reasonably need to come into contact with that information to provide products or services to you or in order to do their jobs. We have physical, electronic, and procedural safeguards that comply with federal regulations to protect personal information about you. However, no system can be 100% secure and there is the possibility that despite Youphenom\'s reasonable efforts, there could be unauthorized access to your personal information. By accessing and using Youphenom&nbsp;services, you assume this risk.</p>\r\n<p>* Youphenom reserves the right to update, amend, or otherwise modify this Privacy Policy at reasonable times. Youphenom will not reduce your rights under this Privacy Policy without your explicit consent. If Youphenom makes material or significant changes to this Privacy Policy, Youphenom may post a prominent notice on Youphenom\'s website along with the updated Privacy Policy. However, your continued use of Youphenom&nbsp;services will signify your acceptance of the changes to this Privacy Policy.</p>'),('terms','<h1>Terms of Service</h1>\r\n<!--?php if(empty($loggeduser)) { ?-->\r\n<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">Youphenom</span><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\">&nbsp;RULES</span></p>\r\n<p>a) Youphenom&nbsp;is a social-networking-style platform that enables users to create \"Profiles\" to express and display their ideas, views, photos, also topics/activities/objects they like. These Profiles are represented in the form of \"Teams\" competing in \"Leagues\". The Teams only compete with other teams in the same League, but the Teams are grouped in the different Leagues not according to related themes, topics, or categories reflected in the Profiles, but according to the \"ranking\" of the Teams based on their record of performance.</p>\r\n<p>b) All the teams in Youphenom are created by users. The Leagues have no relation to any actual existing Leagues. The Teams in Youphenom&nbsp;are not intended to have any relation to actual Teams. If the user chooses to use actual Team\'s (or other entity) features, such as but not limited to Name, Colors, Logo, IT\'S THE RESPONSIBILITY OF THE USER TO OBTAIN ANY NECESSARY LICENSES, COPYRIGHTS, OR OTHER PROPRIETARY RIGHTS PRIOR TO START USING THESE FEATURES!</p>\r\n<p>c) The FREE VERSION allows the user to follow the games, see any team\'s profile page and create one team. The FREE VERSION also gives each user 1 FREE VOTE per DAY (that expires at the end of that day). If you want to vote more times for the same team or another team on the same day, you need to SHOP for votes (which don\'t expire). (Note: it is perfectly in accordance with the Rules to vote for your own team).</p>\r\n<p>To remove the ads provided by Youphenom the FULL VERSION of Youphenom needs to be obtained. (Please note that the full version will remove only ads by Youphenom. Any sponsored advertisements, promotions, coupons and other ads provided by the teams are considered part of their profile and will not be removed in the full version).</p>\r\n<p>Unlimited number of teams is allowed per user account. After the first team is created free of charge, in-app purchase is required for each new team after that.</p>\r\n<p>Each new team is assigned to the highest possible League on the first come first serve basis. After creating a Team and choosing Team Name, Team Colors, etc., it\'s up to the user to promote the Team to accumulate vote-points.</p>\r\n<p>d) The Teams compete against one another based on the number of VOTES (+1 VOTE-POINT for each vote/like received) the teams get during the \"Game\"/\"Match\" (or the whole Season in the case with the Conference League).</p>\r\n<p>e) There are 4 Leagues: L1 (highest ranking), L2, L3, L4 with 28 teams in each League + there is the CONFERENCE-League (the lowest ranking) with unlimited number of teams.</p>\r\n<p>f) Each Game in the 4 Leagues continues 24 hours, during which the teams are getting VOTES/LIKES (1 VOTE = 1 VOTE-POINT) from the users (fans). On the first day of the month there are 14 games (14 pairs of teams) and they play 27 days until every team has played against all the teams in the League. For each win the teams receive 3 points, 1 point for a draw, and 0 points for a loss. (In the Conference League there are no Games/Matches (pairs of teams), the Standings during and at the end of the Season (Month) are based on the amount of votes/likes accumulated by each team throughout the current Season). After the 27th day based on the ranking, the teams are paired in Playoff Games/Matches. The number of points determines the ranking of a team (more points = higher ranking in the standings). If two or more teams have the same number of points the following criteria will be used: (i) greater number of points obtained in the matches between the teams in question, (ii) greater total number of votes during the season, (iii) the team that was created first, (iv) drawing of lots by the Youphenom&nbsp;software system. (Please note the Standings in the Conference are updated in \"real time\", as the Standings in the L1, L2, L3 and L4 are updated only at the end of the Game-day when the game is finished and the distribution of the points for all teams is definite).</p>\r\n<p>g) Playoffs - Playoffs are played in L1, L2, L3 and L4, but not in the Conference League. Playoffs determine the Champion of the particular League and the Teams that will shift to the superior League, but Playoffs don\'t have any effect on the point calculation for the regular season Standings. The teams bound for the Playoffs are highlighted in golden color and the Playoffs are played as follows: (i) for the months with 31 days (as there are 4 extra days after the 27 days of the \"regular\" Season) - Day 28 - Round of 16, Day 29 - Quarter-finals, Day 30 - Semi-finals and Day 31 - Final. In the \"Round of 16\" Team1 will play with Team16, T2-T15, T3-T14, T4-T13, etc. The same for the next rounds the team with the best ranking plays the team with the lowest and so forth. The best 8 teams (those that qualify for the Quarter-finals) will advance for the next superior League for the next Season; (ii) for the months with 30 days (as there are only 3 extra days) there will be no \"Round of 16\", but only Quarter-finals, Semi-finals and Final; (iii) for the months with 29 days - Semi-finals and Final; (iv) for the months with 28 days there will be only final, still 8 teams advance to the next superior League (the 2 finalists + the 3rd-8th place teams during the regular Season). If two teams tie in a Playoff game, the team that ranked better in the regular Season wins.</p>\r\n<p>h) The next Season starts on the 1st day of the next month. The top 8 teams from League2 shifted to League1 and the 8 lowest ranking teams in League1 are now shifted to League2, still 28 teams in each of the Leagues. The same applies to the rest of the Leagues and the Conference. No teams will be relegated from the Conference League since there is no lower ranking League.</p>\r\n<p>Please note that in the Standings, although the golden line indicates the 8 teams that will shift to the next superior League and the white line indicates the 8 teams that will shift to the next lower League for the next Season, they should be used only as guidance, because they may be certain periods and scenarios when this lines are not perfectly accurate. One such case is if there is a team marked by its owner for deletion, as this may affect the calculation of the promotion/relegation, since the deleted teams will be favored for relegation (and ultimately deleted after the end of the Season). For example if there is a deleted team ranked 18th at the end of the regular Season, this team will be relegated instead of the team ranked 21st (best ranked team in the relegation zone), so until the Standings for the next day are calculated, the white line will not represent accurately the exact 8 teams that will be actually relegated.</p>\r\n<p>i) Comments, photos and links to videos can be posted on the Team Profile pages, User Profile pages and Game pages. The users can choose to use their username or the name of one of the teams they own before submitting each post. Users can delete only their own posts.</p>\r\n<p>j) Users can post/sell advertising, sponsorships, or promotions ONLY within the areas specifically designated for this purpose.</p>\r\n<p>k) The aspect ratio for the Sponsored Advertisement is 14:5 and the actual width/he