v&blog=5089392&post=17321&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2013/03/14/maurizio-pelizzone-strumenti-e-metodi-per-lavorare-con-wordpress-in-progetti-complessi/\"><img alt=\"04 Maurizio Pelizzone.mp4\" src=\"http://videos.videopress.com/AOGI9WO3/video-c5e85ec88e_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Mar 2013 07:00:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 3/13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12768\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/nc1L0kLDbSc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1374:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/easy-media-gallery/\"><strong>Easy Media Gallery</strong></a> is designed to display portfolios and various media types including gallery sets, single images, google maps, video, audio, and links with ease and elegance.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/ytlink/\"><strong>ytlink</strong></a> provides a preview image for embedded YouTube videos.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/backwpup/\"><strong>BackWPup</strong></a> allows you to backup your WordPress database, files, and more.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/genericond/\"><strong>Genericon&#8217;d</strong></a> enables easy use of the <a href=\"http://genericons.com\">Genericons</a> icon font set from within WordPress. Icons can be inserted using either HTML or a shortcode.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/keyring/\"><strong>Keyring</strong></a> provides a very hookable, completely customizable framework for connecting your WordPress site to an external service.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wp-all-import/\"><strong>WP All Import</strong></a> makes it easy to import any XML or CSV file into your WordPress site.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/nc1L0kLDbSc\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Mar 2013 05:45:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: The Redhat of Drupal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42287\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2013/03/the-redhat-of-drupal/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1225:\"<p>I got this email today:</p>\n<div class=\"blockquote\">\n<blockquote>Hi Matt,</p>\n<p>I apologize for the cold email. I was researching Automattic , Inc. and wanted to ask you if there was any gaps/pains within your CMS and website.  I work for the &#8220;Redhat of Drupal&#8221;, (Acquia) and we have seen an explosion of Drupal use in the Media, News, and Entertainment Industry.</p>\n<p>Some companies using Drupal/Acquia include Warner Music, Maxim, NBC Universal, and NPR.<br />\nIf you are evaluating your current system or are looking into new web projects, I would love to connect and discuss Drupal as an option. </p>\n<p>Would it make sense to connect on this? If there is someone better at Automattic , Inc. to speak with, perhaps you could point me in the right direction?</p>\n<p>Cheers,</p>\n<p>&#8211;<br />\nDillon J. ********<br />\nEnterprise Drupal Solutions<br />\nDirect: (781) 238-****</p>\n<p>http://www.acquia.com</p>\n<p>Acquia, 25 Corporate Drive Fourth Floor<br />\nBurlington, MA 01803</p>\n<p>Acquia ranked #1 Software Vendor on the 2012 Inc 500</p></blockquote>\n</div>\n<p>Hmmm, maybe I&#8217;ve been <a href=\"http://wordpress.org/\">doing it wrong</a> all these years&#8230; Dillon, I&#8217;ll be in touch!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Mar 2013 16:17:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Matt: SxSW, Work, and Blogging\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42282\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://ma.tt/2013/03/sxsw-work-and-blogging/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2241:\"<p><img class=\"alignright size-thumbnail wp-image-42284\" alt=\"369ajvpd7nrkwmlf1amk\" src=\"http://i2.wp.com/s.ma.tt/files/2013/03/369ajvpd7nrkwmlf1amk.png?resize=195%2C135\" /> I&#8217;ve been at the SxSW festival since Friday, it&#8217;s actually my tenth year attending. Since the first time I used my parent&#8217;s gas card and drove up from Houston this event has had a special place in my heart, even as I&#8217;ve gone in and out of love with it as it&#8217;s grown over the years. (I heard that there were more interactive badges this year than film or music.)</p>\n<p>I&#8217;ve spoken here and there the last few days and it has generated some good blog posts, so here&#8217;s a sampling of them you may find interesting:</p>\n<p>On the way to our interview session <a href=\"http://allthingsd.com/20130310/wordpress-matt-mullenweg-talks-about-future-of-blogging-in-a-sxsw-pedicab/\">Kara Swisher recorded an interview on a pedi-cab</a>.</p>\n<p>Techcrunch TV did a nice short interview, <a href=\"http://techcrunch.com/2013/03/10/wordpress-matt-mullenweg-on-working-from-home-making-money-without-ads-and-more-tctv/\">WordPress’ Matt Mullenweg On Working From Home, Making Money Without Ads, And More [TCTV]</a>.</p>\n<div></div>\n<p><br /></p>\n<p>Paidcontent wrote on <a href=\"http://paidcontent.org/2013/03/09/where-wordpress-is-headed-longform-content-curation-and-maybe-some-native-advertising/\">Where WordPress[.com] is headed: Longform content, curation and maybe even native ads</a>.</p>\n<p>Marketing Land wrote two great posts, <a href=\"http://marketingland.com/wordpress-mullenweg-at-sxsw-blogging-still-booming-35808\">WordPress Founder Matt Mullenweg At SXSW: Blogging Still Booming</a> and <a href=\"http://marketingland.com/why-not-work-from-home-we-have-the-technology-says-wordpress-mullenweg-35814\">Why Not Work From Home? “We Have The Technology,” Says WordPress’ Mullenweg</a>.</p>\n<p>Finally Access PR asked <a href=\"http://blog.accesspr.com/2013/03/wordpress-airbnb-sxsw/\">SXSW: What do WordPress and Airbnb have in common?</a></p>\n<p>The coolest part about this and every year is meeting WordPress users all over &#8212; at restaurants, in the streets, at the booth&#8230; please don&#8217;t hesitate to say hi.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Mar 2013 15:16:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;