 <a href=\"http://buddypress.trac.wordpress.org\">BuddyPress Core Trac</a>.</p>\n<p><a href=\"http://downloads.wordpress.org/plugin/buddypress.zip\">Download BuddyPress 1.7, Beta 2 ↓</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Mar 2013 20:14:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Paul Gibbs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Joseph: I am Speaking at the OpenWest Conference\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://josephscott.org/?p=7033\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"http://josephscott.org/archives/2013/03/i-am-speaking-at-the-openwest-conference/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1818:\"<p><a href=\"http://www.openwest.org/\"><img class=\"alignleft\" alt=\"\" src=\"http://i2.wp.com/www.openwest.org/wp-content/uploads/2013/01/speaker_300.jpg?resize=300%2C388\" /></a></p>\n<p>The <a href=\"http://www.openwest.org/\">OpenWest Conference</a> is happening May 2-4, 2013 (formerly the Utah Open Source Conference) at Utah Valley University in Orem, Utah.</p>\n<p>This year the <a href=\"http://www.openwest.org/keynote/\">keynote speakers</a> are Rasmus Lerdorf, creator of PHP, and Mark Callaghan, lead of the MySQL engineering team at Facebook.</p>\n<p>For my part I&#8217;ll be giving three different presentations this time around.  First up is &#8220;Simple Filesystems with Python and FUSE&#8221;, where I&#8217;ll cover the basics of getting a simple filesystem up and running written in Python using the FUSE library.  Next up is &#8220;Site Testing with CasperJS&#8221;, which is an intro to using <a href=\"http://casperjs.org/\">CasperJS</a> to run user tests against your site.  Last, but not least, is &#8220;Scaling WordPress&#8221;, where I&#8217;ll talk about some of the methods that WordPress.com (the largest WordPress install in the world) uses to host tens of millions of sites that add up to billions of page views per month.</p>\n<p>I tried to keep my session titles direct and to the point.  At times there will up to ten sessions running at once ( <a href=\"http://www.openwest.org/custom/grid.php\">OpenWest session schedule</a> ), so I wanted people to be able to tell at a glance what my sessions are about.</p>\n<p><a href=\"http://www.openwest.org/tickets/\">Tickets for OpenWest</a> are available at $80.  Every open source group in the area has been given a discount code though, so you can bring that down significantly.</p>\n<p>If you&#8217;ll be at the OpenWest conference be sure to say hi.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Mar 2013 16:13:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Joseph Scott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"Weblog Tools Collection: Do You Work From Home?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12760\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/x7WcwEeaJQk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1933:\"<p>There has been <a href=\"http://scottberkun.com/2013/grand-summary-of-posts-on-remote-work-yahoo/\">a lot of talk lately</a> about working from home and maintaining a distributed workforce.</p>\n<p>Web-based software, like <a href=\"http://wordpress.org\">WordPress</a>, <a href=\"http://www.joomla.org\">Joomla</a>, and <a href=\"http://drupal.org\">Drupal</a>, are taking over the publishing industry and allow you to work from anywhere with an internet connection. Though, even though they can be managed  from home, working from home and maintaining a distributed workforce is not yet broadly acknowledged in society as a successful and efficient alternative to working in an office. Despite working with software that doesn&#8217;t need to be tied to one specific workstation, you could still find yourself tied to a desk in cubicle.</p>\n<p>I work full-time for <a href=\"http://automattic.com\">Automattic</a> and have the pleasure of both working from home and setting my own hours. After all, I only need a browser, an email client, and IRC client, and <a href=\"http://www.skype.com/\">Skype</a> to do my job. A desk is nice, but there&#8217;s no one saying that said desk has to be in the dark corner of some corporate office. As for communication between the 150 of us (130 who work from home, far away from the central &#8220;office&#8221; in San Francisco), we communicate mostly via a variety of blogs running the <a href=\"http://p2theme.com\">P2 theme</a>. It&#8217;s as close as you can get to a water cooler or a meeting room with text, you should try it. For other communication needs, we use primarily IRC followed by Skype for less work-related chats.</p>\n<p>Do you work from home? And, if you work from home for a larger company (not just yourself), how is communication and overall efficiency maintained?</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/x7WcwEeaJQk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Mar 2013 14:00:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"WordPress.tv: Martin Reed: Essential SEO + Link Building 101\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=17545\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"http://wordpress.tv/2013/03/12/essential-seo-link-bui